CREATE TABLE `om_ord_exp_out` (
  `ORD_EXP_NO` int(11) NOT NULL COMMENT '주문비용번호',
  `APLY_DVS_CD` varchar(20) NOT NULL COMMENT '적용구분코드',
  `ORD_EXP_TYPE_CD` varchar(20) NOT NULL COMMENT '주문비용유형코드',
  `DLV_EXP` int(10) DEFAULT NULL COMMENT '배송비용',
  `STD_AMT` int(11) DEFAULT NULL COMMENT '기준금액',
  `DLEX_SHAPE_CD` varchar(20) DEFAULT NULL COMMENT '배송비형태코드',
  `RTN_EXP` int(10) DEFAULT NULL COMMENT '반품비용',
  `DLV_CST_POL_ENTSHP_NO` int(11) DEFAULT NULL COMMENT '배송비정책입점번호',
  `DLV_CST_POL_SUP_ENTPRZ_NO` int(11) DEFAULT NULL COMMENT '배송비정책공급업체번호',
  `APLY_DLV_EXP` int(10) DEFAULT NULL COMMENT '적용배송비용',
  `ACTL_PYF_DLV_EXP` int(11) DEFAULT NULL COMMENT '실결제배송비용',
  `DLV_CST_BDN_MNBD_CD` varchar(20) DEFAULT NULL COMMENT '배송비부담주체코드',
  `EXP_FVR_TYPE_CD` varchar(20) DEFAULT NULL COMMENT '비용혜택유형코드',
  `EXP_FVR_AMT` int(10) DEFAULT NULL COMMENT '비용혜택금액',
  `CMPN_NO` varchar(8) DEFAULT NULL COMMENT '캠페인번호',
  `EXP_CNCL_RSN_CD` varchar(20) DEFAULT NULL COMMENT '비용취소사유코드',
  `EXP_PYF_TYPE_CD` varchar(20) DEFAULT NULL COMMENT '비용결제유형코드',
  `CPN_ISS_NO` int(11) DEFAULT NULL COMMENT '쿠폰발급번호',
  `ORIG_ORD_EXP_NO` int(11) DEFAULT NULL COMMENT '원주문비용번호',
  `PYF_CMPLT_DTTM` datetime DEFAULT NULL COMMENT '결제완료일시',
  `CMPN_DC_NO` int(11) DEFAULT NULL COMMENT '캠페인할인번호',
  `ORD_NO` varchar(30) NOT NULL COMMENT '주문번호',
  `CLAIM_NO` int(11) DEFAULT NULL COMMENT '클레임번호',
  `ETL_LOAD_DTTM` datetime NOT NULL COMMENT 'ETL적재일시',
  `ADJU_CRT_DT` varchar(8) DEFAULT NULL COMMENT '정산생성일자',
  `RGST_DTTM` datetime NOT NULL COMMENT '등록일시',
  `RGSTR_ID` varchar(100) NOT NULL COMMENT '등록자아이디',
  `MODI_DTTM` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '수정일시',
  `MODR_ID` varchar(100) NOT NULL COMMENT '수정자아이디',
  PRIMARY KEY (`ORD_EXP_NO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='주문비용';
