DROP TABLE IF EXISTS `om_ord_fvr_out`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `om_ord_fvr_out` (
  `ORD_FVR_NO` int(11) NOT NULL COMMENT '주문혜택번호',
  `APLY_DVS_CD` varchar(20) NOT NULL COMMENT '적용구분코드',
  `ORD_FVR_DVS_CD` varchar(20) NOT NULL COMMENT '주문혜택구분코드',
  `ORD_FVR_TYPE_CD` varchar(20) NOT NULL COMMENT '주문혜택유형코드',
  `APLY_QTY` int(10) NOT NULL COMMENT '적용수량',
  `CNCL_QTY` int(10) NOT NULL DEFAULT '0' COMMENT '취소수량',
  `FVR_AMT` int(10) NOT NULL COMMENT '혜택금액',
  `CMPN_NO` varchar(8) DEFAULT NULL COMMENT '캠페인번호',
  `CMPN_ENTPRZ_SHARE_AMT` int(10) DEFAULT NULL COMMENT '캠페인업체분담금액',
  `FVR_UPRC` int(11) DEFAULT NULL COMMENT '혜택단가',
  `CPN_ISS_NO` int(11) DEFAULT NULL COMMENT '쿠폰발급번호',
  `CMPN_DC_NO` int(11) DEFAULT NULL COMMENT '캠페인할인번호',
  `ORD_NO` varchar(30) NOT NULL COMMENT '주문번호',
  `CLAIM_NO` int(11) DEFAULT NULL COMMENT '클레임번호',
  `CLAIM_SEQ` int(11) DEFAULT NULL COMMENT '클레임순번',
  `ORD_SEQ` int(11) DEFAULT NULL COMMENT '주문순번',
  `ORIG_ORD_FVR_NO` int(11) DEFAULT NULL COMMENT '원주문혜택번호',
  `POINT_ACCM_YN` varchar(1) DEFAULT NULL COMMENT '포인트적립여부',
  `ETL_LOAD_DTTM` datetime NOT NULL COMMENT 'ETL적재일시',
  `ADJU_CRT_DT` varchar(8) DEFAULT NULL COMMENT '정산생성일자',
  `RGST_DTTM` datetime NOT NULL COMMENT '등록일시',
  `RGSTR_ID` varchar(100) NOT NULL COMMENT '등록자아이디',
  `MODI_DTTM` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '수정일시',
  `MODR_ID` varchar(100) NOT NULL COMMENT '수정자아이디',
  PRIMARY KEY (`ORD_FVR_NO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='주문혜택';
